import React, { useEffect } from "react";
import Aos from "aos";
import "aos/dist/aos.css";
import { Container, Row, Col } from "react-bootstrap";

function Contact() {

  useEffect(() => {
   Aos.init({duration: 2000});
  }, []);

  return (
    <Container fluid className="contact-me-section" data-aos="fade-down">
      <Container className="contact-content">
       <Row>
           <fieldset className="form-grid">
             <legend>Contact me</legend>

             <Col md={5}>
             <div>
                 <label htmlFor="full-name">What is your full name?</label>
                 <input type="text" name="full-name" id="full-name" placeholder="Jonh Smith" />
             </div>

             <div>
                 <label htmlFor="email">Whats is your E-mail address?</label>
                 <input type="email" name="email" id="email" placeholder="Your e-mail" />
             </div>
             </Col>

             <Col md={7} className="home-header">
              <div>
                  <label htmlFor="message">Message</label>
                  <textarea name="message" id="message" cols="30" rows="10" placeholder="Your message"></textarea>
              </div>

              <div>
                  <button type="submit">Send message</button>
              </div>
             </Col>
            </fieldset>
       </Row>
      </Container>
    </Container>
  );
}
export default Contact;
